        from collections import defaultdict
        m = defaultdict(int)
        n = defaultdict(int)
        count = 0
        for p in range(len(picture)):
            for q in range(len(picture[0])):
                if picture[p][q] == 'B':
                    m[p] += 1
                    n[q] += 1
        for p in range(len(picture)):
            for q in range(len(picture[0])):
                if picture[p][q] == 'B' and m[p] == 1 and n[q] == 1:
                    count += 1
        return count
    
    
